CREATE TABLE lista (ID CHAR (36) NOT NULL CHECK (length("ID") = 36), PRIORITATE SMALLINT (6) DEFAULT NULL CHECK (typeof(PRIORITATE) = 'integer'), DENUMIRE VARCHAR (25) DEFAULT NULL CHECK (length("DENUMIRE") <= 25), MAGAZIN VARCHAR (25) CHECK (length("MAGAZIN") <= 25) DEFAULT NULL, SCURT VARCHAR (3) DEFAULT NULL CHECK (length("SCURT") <= 3), DESCRIERE VARCHAR (20) DEFAULT NULL CHECK (length("DESCRIERE") <= 20), VALOARE DECIMAL (11, 2) DEFAULT (0) CHECK (typeof(VALOARE) = 'real' or typeof(VALOARE) = 'integer'), NEVOIE TINYINT (1) DEFAULT (0) CHECK (typeof(NEVOIE) = 'integer'), PERIOADA VARCHAR (15) DEFAULT NULL CHECK (length("PERIOADA") <= 15), DATA DATE CHECK (date(DATA) IS NOT NULL), ACTIV TINYINT (1) DEFAULT (0) CHECK (typeof(ACTIV) = 'integer'), O CHAR (1) NOT NULL CHECK (length("O") = 1), PRIMARY KEY (ID));INSERT INTO lista VALUES('021CFA9E-7D6C-11EA-ADEB-00FF013B0A26', 1, 'royal.min.puppy.PRT', 'PETMART', 'PRT', '1x4kg/94,85lei', 94.85, 0, '6. ocazional', '05.05.2020', 1, '-');
CREATE TABLE cheltuieli (ID CHAR (36) NOT NULL CHECK (length("ID") = 36), DENUMIRE varchar (25) DEFAULT NULL CHECK (length("DENUMIRE") <= 25), MAGAZIN VARCHAR (25) DEFAULT NULL CHECK (length("MAGAZIN") <= 25), DESCRIERE varchar (20) DEFAULT NULL CHECK (length("DESCRIERE") <= 20), AN smallint (6) DEFAULT NULL CHECK (typeof(AN) = 'integer'), LUNA smallint (6) DEFAULT NULL CHECK (typeof(LUNA) = 'integer'), ZIUA smallint (6) DEFAULT NULL CHECK (typeof(ZIUA) = 'integer'), VALOARE decimal (11, 2) DEFAULT (0.0) CHECK (typeof(VALOARE) = 'real' or typeof(VALOARE) = 'integer'), SEMN char (1) DEFAULT NULL CHECK (length("SEMN") <= 1));INSERT INTO cheltuieli VALUES('9e81266c-9830-446f-9b01-5af4e1811fba', 'cablu+internet tv', ' tv', 'FACTURĂ', 2020, 1, 10, 61, '-');
